      "reviewText": "I purchased this item locally at a discount store for much less, so be sure to check around before you buy.I purchased two, knowing that with my history I'd be lucky with 10 percent actually sprouting. But I was wrong! My granddaughter and I did the first tray together. She poured the water, then I counted out the seeds for her to plant. Her Mom and I did the second tray after she got bored. Within three days the first of the plants were up. It has now been 8 days and nearly every pellet has seedlings. I have already had to move the first ones (cantaloupe) to a large peat pot since they are five inches tall! I am using one of the top covers under the four large peat pots.Almost all of the others are 2 inches tall, but still fragile.This will be my first garden grown completely from seed, and I will definitely use this again next year!Edited, All of the plants are in the ground and doing well! Tomatoes are sprawling all over the place, Zucchini have flowers, even the cantaloupe are starting to perk up now that the weather is warmer.",
